import { StyleSheet } from "react-native";
export const styles = StyleSheet.create({
  primary: {
    backgroundColor: "#72063c",
    borderRadius: 28,
    paddingVertical: 8,
    paddingHorizontal: 16,
    elevation: 2,
    text: {
      color: "white",
      fontSize: 19,
      textAlign: "center",
    },
  },
});
